script: |
  super -f text -I q6966.spq | sort > q6966.out

inputs:
  - name: q6966.spq
    data: |
      SELECT ALL - 18 / - CAST ( NULL AS INTEGER ) AS col2 FROM tab2 (FORMAT parquet) WHERE - 9 NOT BETWEEN - col2 * col0 AND 40 + + col0 + 60;
  - name: tab2

outputs:
  - name: q6966.out
    data: |
